package Entity;

public class LxNum {
	
	private String lx;
	private String num;
	
	public LxNum(String lx, String num) {
		super();
		this.lx = lx;
		this.num = num;
	}

	public LxNum() {
		super();
		// TODO Auto-generated constructor stub
	}

	public String getLx() {
		return lx;
	}

	public void setLx(String lx) {
		this.lx = lx;
	}

	public String getNum() {
		return num;
	}

	public void setNum(String num) {
		this.num = num;
	}
	
	
	
}
